      "_meta_keywords": "Door furniture, door handles, bathroom accessories, door knobs and handles, door handles and knobs, door handles knobs, door hardware, hardware, door knobs hardware, designer doorware",
      "_title": null,
      "_content": "<p>Designer Doorware designs and manufactures superior quality door furniture and architectural hardware including <a href=\"http://www.designerdoorware.com.au/catalogue/Door-Handles/\" target=\"_blank\">door handles</a> and knobs, <a href=\"http://www.designerdoorware.com.au/catalogue/door-pull-handles/\" target=\"_blank\">door pull handles</a>, <a href=\"http://www.designerdoorware.com.au/catalogue/sliding-door-hardware/\" target=\"_blank\">sliding door hardware</a>, <a href=\"http://www.designerdoorware.com.au/catalogue/door-hardware-accessories/\" target=\"_blank\">door hardware accessories</a>, <a href=\"http://www.designerdoorware.com.au/catalogue/Door-closers/\" target=\"_blank\">door closers</a>, <a href=\"http://www.designerdoorware.com.au/catalogue/Locks/\" target=\"_blank\">locks,</a> <a href=\"http://www.designerdoorware.com.au/catalogue/cabinet-handles/\" target=\"_blank\">cabinet door handles</a>, and <a href=\"http://www.designerdoorware.com.au/catalogue/bathroom-accessories/\" target=\"_blank\">bathroom accessories</a>. Our products offer timeless qualities to suit a variety of architectural styles and budgets, with thousands of product options and combinations to choose from.</p>\n\n<p>If you are looking for something extra special, our <a href=\"http://www.designerdoorware.com.au/door-hardware-gallery\" target=\"_blank\" title=\"Custom Design Service\">custom design service</a> can create hardware to complement any commercial or residential project, no matter how unique your requirements. We regularly work with Architects, Designers, Developers and Builders on award winning <a href=\"http://www.designerdoorware.com.au/project-showcase\" target=\"_blank\" title=\"Project Gallery\">projects</a> of all sizes across Australia, Asia-Pacific and the USA. With know-how gained through many years of specialised design experience, a well-established <a href=\"http://www.designerdoorware.com.au/usa-distributors\" target=\"_blank\" title=\"International network\">international network</a> and best-of-breed manufacturing capabilities, we can operate to short lead times and quickly deliver doorware and accessories anywhere in the world.</p>\n\n<p>Our new <a href=\"http://www.designerdoorware.com.au/Doorware-Selection-Online-1\" target=\"_blank\" title=\"Selector tool\">Selector Tool</a> makes it easy to visualise, compare and <a href=\"http://www.designerdoorware.com.au/catalogue/\" target=\"_blank\">select architectural hardware online</a>. You can review a wide&nbsp;range of products, find&nbsp;related products, get tailored specification sheets, make them into a PDF book and request a quote for your specified products. We also make doorware selection easier with <a href=\"http://www.designerdoorware.com.au/Our_Services\" target=\"_blank\" title=\"Customer Services\">customer services</a> that incorporate interior <a href=\"http://www.designerdoorware.com.au/door-hardware-design-advice\" target=\"_blank\">design advice</a>, <a href=\"http://www.designerdoorware.com.au/door-hardware-specifying-products\" target=\"_blank\">specifying</a>, <a href=\"http://www.designerdoorware.com.au/door-hardware-scheduling\" target=\"_blank\">scheduling</a> and more. <a href=\"http://www.designerdoorware.com.au/index.php?pageID=17182&amp;action=fcreator&amp;fid=114&amp;sectionID=17180\" target=\"_blank\">Contact</a> our friendly, highly qualified team to help create that final complement to your project.</p>\n",
